import React from 'react';

interface IProduct{
    sNo:string;
    Name:string;
    image:string;
    price:number;
    qty:number;
}
interface IProps{

}
interface IState{
product:IProduct;
}
class Product extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props);
        this.state={
            product:{
                sNo:'AA01',
                Name:'Apple Watch',
                image:'https://i.pinimg.com/originals/2a/c0/80/2ac080d81fbf6780bc5163e3398a6f92.jpg',
                price:5000,
                qty:2
            }
        }
   
    }   
        
    
  
        
    

    
    render()
    {
        let {product}=this.state
        return(
<React.Fragment>
<section>
    <div className='container'>
        <div className='row'>
            <div className='col'>
                <h3>Product Item</h3>
                <p>India's biggest online store for Mobiles, Fashion (Clothes/Shoes), Electronics, Home Appliances, Books, Home, Furniture, Grocery, Jewelry, Sporting goods, ...</p>
            </div>
        </div>
    </div>
</section>
<section>
    <div className='container'>
        <div className='row'>
            <div className='col'>
                <table className='bg-warning text-center'>
                    <thead>
                        <tr>
                            <th>sNo</th>
                            <th>Name</th>
                            <th>Image</th>
                            <th>Price</th>
                            <th>Qty</th>
                            <th>Total</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{product.sNo}</td>
                            <td><img src={product.image} alt="" width="50px" height="50px"></img></td>
                            <td>{product.price}</td>
                            <td>{product.qty}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>

    </div>
</section>
</React.Fragment>
        )
    }
};
export default Product;
